import {Link, Outlet} from "react-router-dom";

function Articles(){
    return (
        <div>
            <Outlet/>
                <ul>
                    <li>
                        <Link to="/articles/1"> 게시글1</Link>
                    </li>
                    <li>
                        <Link to="/articles/2"> 게시글2</Link>
                    </li>
                    <li>
                        <Link to="/articles/3"> 게시글3</Link>
                    </li>
                </ul>
        </div>
    );
};

export default Articles;
